export default (req, res) => {
  res.statusCode = 200
  res.setHeader('Content-Type', 'application/json')
  res.end(JSON.stringify({
      name: 'Harris Beg',
      linkedIn: 'linkedin.com/harrisbegcca',
      github: 'github.com/hbg',
      resume: 'harrisbeg.com/'
  }))
}
